import React from "react";
// import Data from "./Data";

const Card = () => {
  let data = {
    id: 1,
    name: "sourav",
    age: 22,
    state: "odisha",
  };
  return (
    <>
      <h1>{data.id}</h1>
      
    </>
  );
};

export default Card;
